  "Allegations" : "NASD RULES 2110 AND 2310:  FROM SEPTEMBER 2002 THROUGH MARCH 2006, GILPIN-MORGAN ENGAGED IN EXCESSIVE AND UNSUITABLE TRADING IN THE INDIVIDUAL RETIREMENT ACCOUNT OF A PUBLIC CUSTOMER, AN ACCOUNT OVER WHICH SHE EXERCISED WRITTEN DISCRETIONARY AUTHORITY. SUCH TRADING WAS INCONSISTENT WITH THE INVESTMENT OBJECTIVES AND FINANCIAL SITUATION AND NEEDS OF THE CUSTOMER. ALSO, IN NOVEMBER 2006, GILPIN-MORGAN SETTLED OR ATTEMPTED TO SETTLE, A CUSTOMER COMPLAINT BY SENDING THE CUSTOMER FOUR PERSONAL CHECKS IN THE TOTAL AMOUNT OF $6,000, WITHOUT PROVIDING PRIOR NOTICE TO HER MEMBER FIRM REGARDING THESE SETTLEMENT EFFORTS WITH THE CUSTOMER.",
