      "Amount" : "$10,000.00"
    } ]
  }, {
    "Sanctions" : "Disgorgement/Restitution"
  }, {
    "Sanctions" : "Suspension"
  } ],
  "Sanction Details" : "WITHOUT ADMITTING OR DENYING THE FINDINGS, GILPIN-MORGAN CONSENTED TO THE DESCRIBED SANCTIONS AND TO THE ENTRY OF FINDINGS; THEREFORE SHE IS FINED $10,000, SUSPENDED FROM ASSOCIATION WITH ANY FINRA MEMBER IN ANY CAPACITY FOR ONE YEAR AND ORDERED TO PAY $45,775.23, PLUS INTEREST, IN RESTITUTION TO A PUBLIC CUSTOMER.  THE FINE AND RESTITUTION SHALL BE DUE AND PAYABLE EITHER IMMEDIATELY UPON REASSOCIATION WITH A MEMBER FIRM FOLLOWING THE ONE YEAR SUSPENSION OR PRIOR TO ANY APPLICATION OR REQUEST FOR RELIEF FROM ANY STATUTORY DISQUALIFICATION RESULTING FROM THIS OR ANY OTHER EVENT OR PROCEEDING, WHICHEVER IS EARLIER. IF FOR ANY REASON GILPIN-MORGAN CANNOT LOCATE ANY CUSTOMER AFTER REASONABLE AND DOCUMENTED EFFORTS WITHIN SUCH PERIOD, OR SUCH ADDITIONAL PERIOD AGREED TO BY FINRA, GILPIN-MORGAN SHALL FORWARD ANY UNDISTRIBUTED RESTITUTION AND INTEREST TO THE APPROPRIATE ESCHEAT, UNCLAIMED PROPERTY, OR ABANDONED PROPERTY FUND FOR THE STATE IN WHICH THE CUSTOMER LAST RESIDED. THE IMPOSITION OF A RESTITUTION ORDER OR ANY OTHER MONETARY SANCTION HEREIN, AND TIMING OF SUCH ORDERED PAYMENTS, DOES NOT PRECLUDE THE CUSTOMER FROM PURSUING HER OWN ACTIONS TO OBTAIN RESTITUTION OR OTHER REMEDIES. THE SUSPENSION IN ANY CAPACITY IS IN EFFECT FROM OCTOBER 15, 2007, THROUGH OCTOBER 14, 2008."
